import { bikiniServices } from '../../data';

const WaxServices = () => {
  return (
    <div className="grid place-items-center">
      <div className="w-3/4 grid grid-cols-1 sm:grid-cols-2 gap-x-6">
        {bikiniServices.map((service, index) => (
          <div
            key={index}
            className="bg-gray-100 p-8 rounded-md border border-solid border-black mb-6">
            <div className="flex justify-between">
              <p>{service.serviceName}</p>
              <p>${service.price}</p>
            </div>
            <div>
              <p>{service.description}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default WaxServices;
